import React from "react";


export default function Card({
card
}) {

return (
<div className="card">
<img className="card__image" src={this.props.card.link} />
<h2 className="card__place-name">{this.props.card.name}</h2>
<button
  className="card__like-button"
  type="button"
  aria-label="поставить лайк"
></button>
<span className="card__like-count">{this.props.card.likes}</span>
<button
  className="card__remove-button"
  type="button"
  aria-label="удалить карточку"
></button>
</div>
)
}
